(function() {
  window.HomeView = Backbone.View.extend({
    el: "body",
    initialize: function() {
      return $('#nav_home').addClass("active");
    }
  });

}).call(this);
(function() {
  window.ArticleView = Backbone.View.extend({
    el: "body",
    initialize: function() {
      $('#nav_articles').addClass("active");
      this.init_edit();
      return this.init_button_goto_url();
    },
    preview: function(body) {
      $("#preview").text("Loading...");
      return $.post("/articles/preview", {
        "body": body
      }, function(data) {
        return $("#preview").html(data.body);
      }, "json");
    },
    init_edit: function(e) {
      var preview_box, self;
      self = this;
      preview_box = $(document.createElement("div")).attr("id", "preview");
      preview_box.addClass("markdown form-control");
      $('textarea').after(preview_box);
      preview_box.hide();
      $(".edit a").click(function() {
        $(".preview").removeClass("active");
        $(this).parent().addClass("active");
        $(preview_box).hide();
        $('textarea').show();
        return false;
      });
      return $(".preview a").click(function() {
        $(".edit").removeClass("active");
        $(this).parent().addClass("active");
        $(preview_box).show();
        $('textarea').hide();
        self.preview($('textarea').val());
        return false;
      });
    },
    init_button_goto_url: function() {
      return $("#button_go_url").click(function() {
        var limit, offset, url;
        url = $("#button_go_url").attr('url');
        limit = $("#button_go_url").attr('limit');
        offset = ($('#page_num').val() - 1) * limit;
        return window.location.href = url + "?" + "offset=" + offset + "&&" + "limit=" + limit;
      });
    }
  });

}).call(this);
(function() {
  window.AboutView = Backbone.View.extend({
    el: "body",
    initialize: function() {
      return $('#nav_about').addClass("active");
    }
  });

}).call(this);
(function() {
  var AppView;

  AppView = Backbone.View.extend({
    el: "body",
    events: {
      "click .btn-move-page": "scrollPage"
    },
    initialize: function() {
      switch ($('body').data('controller-name')) {
        case 'articles':
          window._articleView = new ArticleView();
          break;
        case 'home':
          window._homeView = new HomeView();
          break;
        case 'abouts':
          window._aboutView = new AboutView();
      }
      return this.init_scroll();
    },
    scrollPage: function(e) {
      var moveType, opts, target;
      target = $(e.currentTarget);
      moveType = target.data('type');
      opts = {
        scrollTop: 0
      };
      if (moveType === 'bottom') {
        opts.scrollTop = $('body').height();
      }
      $("body, html").animate(opts, 300);
      return false;
    },
    init_scroll: function(e) {
      var body_height, height, window_height;
      window_height = $(window).height();
      body_height = $('body').height();
      height = body_height - window_height;
      if ($(window).scrollTop() === 0) {
        $('.jump_top').addClass("hide");
      }
      if ($(window).scrollTop() === height) {
        $('.jump_bottom').addClass("hide");
      }
      return $(window).scroll(function() {
        var scrollTop_value;
        scrollTop_value = $(window).scrollTop();
        if (scrollTop_value > 0) {
          $('.jump_top').removeClass("hide");
        } else {
          $('.jump_top').addClass("hide");
        }
        if (scrollTop_value < height) {
          return $('.jump_bottom').removeClass("hide");
        } else {
          return $('.jump_bottom').addClass("hide");
        }
      });
    }
  });

  $(document).on("turbolinks:load", function() {
    return window._appView = new AppView();
  });

}).call(this);
